import React from 'react'
import Link from 'next/link'

import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import Attraction from '../components/Attraction'
import { Button, Card } from 'react-bootstrap';

type attr = {
	id: number,
	name: string,
	tags: string[],
	number_of_reviews: number,
	main_photo_url: string
	rating: number,
	location_lng: number,
	location_lat: number,
	opening_hours: number[],
	created: string,
	source: string,
	address: string,
	about: number,
	order_page: any,
	is_free: boolean,
	price: any
}

const indexPage = () => {
	const attractionsData: attr[] = require('../data/attractions_museums_tlv.json')
	return (

		<div>
			<h1>Hello Bridgify!! :)</h1>
			<p>go to <Link href="/auth"><a>Auth</a></Link></p>
			<Card style={{ width: '18rem' }}>
				<Card.Img variant="top" width='100%' src="https://lh3.googleusercontent.com/p/AF1QipNTVN0BVl2PXNJWTIHD751MEOpWJwTQmZHkbqA3=s1600-w2000-h2000" />
				<Card.Body>
					<Card.Title>Card Title</Card.Title>
					<Card.Text>
						Some quick example text to build on the card title and make up the bulk of
						the card's content.
    			</Card.Text>
					<Button variant="primary">Go somewhere</Button>
				</Card.Body>
			</Card>
			{attractionsData.map(attr =>
				<Attraction
					key={attr.id}
					name={attr.name}
					number_of_reviews={attr.number_of_reviews}
					rating={attr.rating}
					tags={attr.tags}
				></Attraction>)}
		</div>
	)
}


export default indexPage

//  1. Create an index web page which contains a designed list of attractions
// a.import JSON file
// b. map it into components
// c. design the components
